import { Grid } from "@mui/material";
import React from "react";

const Header = () => {
  return (
    <div
      style={{
        position: "relative",
      }}
    >
      <Grid
        container
        style={{
          position: "absolute",
          top: 0,
          bottom: 0,
          left: 0,
          right: 0,
        }}
      >
        <Grid
          xs={12}
          sm={6}
          md={8}
          sx={{
            backgroundColor: "white",
          }}
        ></Grid>
        <Grid
          xs={12}
          sm={6}
          md={4}
          sx={{
            backgroundColor: "#00B0EF",
          }}
        ></Grid>
      </Grid>

      <div
        style={{
          position: "absolute",
          top: 0,
          bottom: 0,
          left: 0,
          right: 0,
          zIndex: 100,
        }}
      ></div>
    </div>
  );
};

export default Header;
